import React from "react";

function NBAGames() {
	const gameStyle = {
		marginBottom: "20px",
	};

	const tableStyle = {
		borderCollapse: "collapse",
		marginTop: "10px",
	};

	const cellStyle = {
		border: "1px solid black",
		padding: "5px",
		textAlign: "center",
	};

	return (
		<div>
			<h1>NBA Games Happening Today</h1>
			<ul style={{ listStyleType: "none", padding: 0 }}>
				<li style={gameStyle}>
					Washington Wizards at Cleveland Cavaliers - 7:00 PM ET
					<table style={tableStyle}>
						<tr>
							<td style={cellStyle}>3</td>
							<td style={cellStyle}>210</td>
						</tr>
						<tr>
							<td style={cellStyle}>-3</td>
							<td style={cellStyle}>215</td>
						</tr>
						<tr>
							<td colSpan="2" style={cellStyle}>
								Spread | O/U
							</td>
						</tr>
					</table>
				</li>
				{/* Repeat the same structure for other games */}
			</ul>
		</div>
	);
}

export default NBAGames;
